// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract GameDirectory is Ownable {
    IERC20 public winDoge95Token; // Changed from gameToken to winDoge95Token
    uint256 public listingFee; // Added missing identifier
    uint256 public approvalThreshold; // Added missing identifier

    struct Game {
        string title;
        string description;
        string category;
        string imageUrl;
        string gameUrl;
        address owner; // Changed from submitter to owner
        uint256 approvalVotes;
        uint256 rejectionVotes;
        bool approved;
        bool rejected;
    }

    Game[] public games;
    mapping(address => mapping(uint256 => bool)) public hasVoted;

    event GameListed(uint256 indexed gameId, address indexed owner);
    event GameVoted(uint256 indexed gameId, address indexed voter, bool approved, uint256 weight);
    event GameApproved(uint256 indexed gameId);
    event GameRejected(uint256 indexed gameId);

    constructor(address _winDoge95Token, uint256 _listingFee, uint256 _approvalThreshold) Ownable(msg.sender) {
        winDoge95Token = IERC20(_winDoge95Token); // Changed from gameToken to winDoge95Token
        listingFee = _listingFee;
        approvalThreshold = _approvalThreshold;
    }

    function listGame(string memory _title, string memory _description, string memory _category, string memory _imageUrl, string memory _gameUrl) external {
        require(winDoge95Token.transferFrom(msg.sender, address(this), listingFee), "Listing fee transfer failed"); // Changed from gameToken to winDoge95Token

        games.push(Game({
            title: _title,
            description: _description,
            category: _category,
            imageUrl: _imageUrl,
            gameUrl: _gameUrl,
            owner: msg.sender, // Store the wallet address that listed the game
            approvalVotes: 0,
            rejectionVotes: 0,
            approved: false,
            rejected: false
        }));

        emit GameListed(games.length - 1, msg.sender);
    }

    function voteForGame(uint256 _gameId, bool _approve) external {
        require(_gameId < games.length, "Invalid game ID");
        require(!games[_gameId].approved && !games[_gameId].rejected, "Voting has ended for this game");
        require(!hasVoted[msg.sender][_gameId], "Already voted for this game");

        uint256 voterBalance = winDoge95Token.balanceOf(msg.sender); // Changed from gameToken to winDoge95Token
        uint256 totalSupply = winDoge95Token.totalSupply(); // Changed from gameToken to winDoge95Token
        uint256 voteWeight = (voterBalance * 10000) / totalSupply; // Vote weight as basis points (1/100 of a percent)

        if (_approve) {
            games[_gameId].approvalVotes += voteWeight;
        } else {
            games[_gameId].rejectionVotes += voteWeight;
        }

        hasVoted[msg.sender][_gameId] = true;

        emit GameVoted(_gameId, msg.sender, _approve, voteWeight);

        if (games[_gameId].approvalVotes >= approvalThreshold * 100) {
            games[_gameId].approved = true;
            emit GameApproved(_gameId);
        } else if (games[_gameId].rejectionVotes >= (10000 - approvalThreshold * 100)) {
            games[_gameId].rejected = true;
            emit GameRejected(_gameId);
        }
    }

    function getGame(uint256 _gameId) external view returns (Game memory) {
        require(_gameId < games.length, "Invalid game ID");
        return games[_gameId];
    }

    function getGameCount() external view returns (uint256) {
        return games.length;
    }

    function setListingFee(uint256 _newFee) external onlyOwner {
        listingFee = _newFee;
    }

    function setApprovalThreshold(uint256 _newThreshold) external onlyOwner {
        require(_newThreshold > 0 && _newThreshold <= 100, "Invalid threshold");
        approvalThreshold = _newThreshold;
    }

    function withdrawFees() external onlyOwner {
        uint256 balance = winDoge95Token.balanceOf(address(this)); // Changed from gameToken to winDoge95Token
        require(winDoge95Token.transfer(owner(), balance), "Fee withdrawal failed"); // Changed from gameToken to winDoge95Token
    }
}

