// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

// Flattened ERC20 interface
interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

// Flattened Ownable contract
contract Ownable {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    constructor() {
        _owner = msg.sender;
        emit OwnershipTransferred(address(0), _owner);
    }

    function owner() public view returns (address) {
        return _owner;
    }

    modifier onlyOwner() {
        require(_owner == msg.sender, "Ownable: caller is not the owner");
        _;
    }

    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

interface IUniswapV2Factory {
    function createPair(address tokenA, address tokenB) external returns (address pair);
}

interface IUniswapV2Router02 {
    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;

    function factory() external pure returns (address);
    function WETH() external pure returns (address);

    function addLiquidityETH(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    ) external payable returns (uint256 amountToken, uint256 amountETH, uint256 liquidity);
}

contract Windoge95 is IERC20, Ownable {
    string private constant _name = "Windoge95";
    string private constant _symbol = "WIN95";
    uint8 private constant _decimals = 9;
    uint256 public constant MAX_BUY_TAX = 150; // 15%
    uint256 public constant MAX_SELL_TAX = 150; // 15%

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    uint256 private _totalSupply;

    uint256 public buyTaxRate;
    uint256 public sellTaxRate;

    address public Treasury;
    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;

    bool private swapping;
    uint256 public swapTokensAtAmount;

    mapping(address => bool) private _isExcludedFromFees;

    event SwapAndLiquify(uint256 tokensSwapped, uint256 ethReceived, uint256 tokensIntoLiquidity);

    constructor(address _routerAddress) {
        _totalSupply = 100000000 * 10**_decimals;
        _balances[msg.sender] = _totalSupply;

        buyTaxRate = 5;
        sellTaxRate = 5;
        swapTokensAtAmount = _totalSupply * 1 / 1000; // 0.1% of total supply

        Treasury = 0x3d7B2092a2599cc28c6cDdAe3b321137a2cDf050;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(_routerAddress);
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), _uniswapV2Router.WETH());

        _isExcludedFromFees[owner()] = true;
        _isExcludedFromFees[address(this)] = true;
        _isExcludedFromFees[Treasury] = true;

        emit Transfer(address(0), msg.sender, _totalSupply);
    }

    bool public tradingEnabled = false;

    modifier onlyTreasury() {
        require(msg.sender == Treasury, "Only Treasury can call this function");
        _;
    }

    function enableTrading() external onlyTreasury {
        require(!tradingEnabled, "Trading is already enabled");
        tradingEnabled = true;
    }

    function name() public pure returns (string memory) {
        return _name;
    }

    function symbol() public pure returns (string memory) {
        return _symbol;
    }

    function decimals() public pure returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        uint256 currentAllowance = _allowances[sender][msg.sender];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        unchecked {
            _approve(sender, msg.sender, currentAllowance - amount);
        }
        _transfer(sender, recipient, amount);
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal {
        require(tradingEnabled || _isExcludedFromFees[sender] || _isExcludedFromFees[recipient], "Trading is not enabled yet");
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        uint256 taxAmount = 0;
        if (!_isExcludedFromFees[sender] && !_isExcludedFromFees[recipient]) {
            taxAmount = amount * (sender == uniswapV2Pair ? buyTaxRate : sellTaxRate) / 100;
        }

        if (taxAmount > 0) {
            _balances[address(this)] += taxAmount;
            amount -= taxAmount;

            if (_balances[address(this)] >= swapTokensAtAmount && !swapping && sender != uniswapV2Pair) {
                swapAndSendToFee(swapTokensAtAmount);
            }
        }

        _balances[sender] -= amount;
        _balances[recipient] += amount;

        emit Transfer(sender, recipient, amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function swapAndSendToFee(uint256 tokenAmount) private {
        swapping = true;
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            Treasury,
            block.timestamp
        );

        swapping = false;
    }

    function setTaxRates(uint256 newBuyTaxRate, uint256 newSellTaxRate) external onlyOwner {
        require(newBuyTaxRate <= MAX_BUY_TAX && newSellTaxRate <= MAX_SELL_TAX, "Tax rate cannot exceed 15%");
        buyTaxRate = newBuyTaxRate;
        sellTaxRate = newSellTaxRate;
    }

    function excludeFromFees(address account) external onlyOwner {
        _isExcludedFromFees[account] = true;
    }

    function includeInFees(address account) external onlyOwner {
        _isExcludedFromFees[account] = false;
    }

    function setTreasury(address newTreasury) external onlyOwner {
        require(newTreasury != address(0), "Treasury cannot be zero address");
        Treasury = newTreasury;
    }

    function setSwapTokensAtAmount(uint256 amount) external onlyOwner {
        swapTokensAtAmount = amount;
    }

    receive() external payable {}

    function withdrawETH() external {
        require(msg.sender == Treasury, "Only Treasury can withdraw");
        uint256 balance = address(this).balance;
        require(balance > 0, "No ETH to withdraw");
        (bool success, ) = Treasury.call{value: balance}("");
        require(success, "ETH withdrawal failed");
    }
}

